import React, { Suspense, useRef, useState } from 'react';
import { Canvas, useLoader } from '@react-three/fiber';
import { OrbitControls, Html, Plane } from '@react-three/drei';
import * as THREE from 'three';

function BoxWall({ position, rotation, scale, artwork }) {
  const texture = useLoader(THREE.TextureLoader, artwork);
  const mesh = useRef();


  function useCameraBounds(camera, controls) {
    useEffect(() => {
      const checkBounds = () => {
        // Implement boundary logic
        camera.position.clamp(new THREE.Vector3(-2, 1, -2), new THREE.Vector3(2, 3, 2));
      };

      controls.addEventListener('change', checkBounds);
      return () => controls.removeEventListener('change', checkBounds);
    }, [camera, controls]);
  }

  function Room() {
    const { camera, gl: { domElement } } = useThree();
    const controls = useRef(null);
    useCameraBounds(camera, controls.current);

    return (
      <>
        <OrbitControls ref={controls} args={[camera, domElement]} />
        {/* Room geometry here */}
      </>
    );
  }

  return (
    <mesh position={position} rotation={rotation} scale={scale} ref={mesh}>
      <planeGeometry args={[1, 1]} />
      <meshStandardMaterial map={texture} side={THREE.DoubleSide} />
    </mesh>
  );
}

function Room() {
  const [selectedArt, setSelectedArt] = useState(null);

  return (
    <>
      {/* Walls */}
      <Suspense fallback={null}>  // Handle asynchronous texture loading
        <BoxWall position={[-2.5, 0, 0]} rotation={[0, Math.PI / 2, 0]} scale={[5, 5, 0.1]} artwork="assets/images/wall.jpg" />
        <BoxWall position={[2.5, 0, 0]} rotation={[0, -Math.PI / 2, 0]} scale={[5, 5, 0.1]} artwork="assets/images/wall.jpg" />
        <BoxWall position={[0, 0, -2.5]} rotation={[0, 0, 0]} scale={[5, 5, 0.1]} artwork="assets/images/wall.jpg" />
        <BoxWall position={[0, 0, 2.5]} rotation={[0, Math.PI, 0]} scale={[5, 5, 0.1]} artwork="assets/images/wall.jpg" />
        <BoxWall position={[0, 2.5, 0]} rotation={[-Math.PI / 2, 0, 0]} scale={[5, 5, 0.1]} artwork="assets/images/ceiling.jpg" />
        <BoxWall position={[0, -2.5, 0]} rotation={[Math.PI / 2, 0, 0]} scale={[5, 5, 0.1]} artwork="assets/images/floor.jpg" />
      </Suspense>
<OrbitControls enableZoom={false} enablePan={false} enableRotate={true} />
      {selectedArt && (
        <Html position={[0, 0, 0]} center>
          <div className="art-details" style={{ background: 'white', padding: '10px' }}>
            {selectedArt}
          </div>
        </Html>
      )}
    </>
  );
}

function App() {
  return (
    <div className="App" style={{ height: '100vh', width: '100vw' }}>
      <Canvas camera={{ position: [0, 1, 2], fov: 75 }}>
        <ambientLight intensity={0.5} />
        <pointLight position={[10, 10, 10]} />
        <Room />
      </Canvas>
    </div>
  );
}

export default App;
